ARTICLE 19 : MESURES DE SECURITE ET D’HYGIENE  
En application de l’article 33 du CCAG.T, le titulaire  est seul responsable de la sécurité sur le chantier 
découlant de son activité. Il doit  notamment  :  
- Mettre des casques de protection à la disposition des intervenants du chantier  ; 
- Toutes mesures assurant la sécurité et la protection de tous les intervenants  ; 
- Laisser les locaux parfaitement nets  ; 
- Déposer les gravois et débris au voisinage du chantier en un ou plusieurs endroits désignés 
par le comité de suivi et seront évacués aux décharges publi ques aux frais du titulaire  ;  
- Veiller à ce qu’après l'exécution des peintures, les bâtiments devront être dans un état de 
propreté indispensable à l'introduction des usagers  ; 
- Dégager des menuiseries et serrures bloquées par la peinture par des retouches 
consécutives nécessaires  ; 
- Mettre en état les appareils sanitaires à débarrasser de leur plâtre protecteur et les poncer 
soigneusement avec un produit adéquat pour éliminer les rayures et tâches diverses et 
leur rendre leur éclat.

